//                </tr>
//            </thead>
//            <tbody>
//                {data.map(item => (
//                    <tr key={item.date}>
//                        {isLocation ? (
//                            <>
//                                <td>{item.date}</td>
//                                <td>{item.country}</td>
//                                <td>{item.continent}</td>
//                                <td>{item.population}</td>
//                                <td>{item.summary}</td>
//                            </>
//                        ) : (
//                            <>
//                                <td>{item.date}</td>
//                                <td>{item.temperatureC}</td>
